import React from "react";
import FetchWeather from "./api/fetchData";
import "./App.module.css";
const App = () => {
  return (
    <React.Fragment>
      <div className="main-container">
        <input type="text" className="search" />
      </div>
    </React.Fragment>
  );
};

export default App;
